	(585, 'Modules\\Translation\\Entities\\TranslationTranslation', 583, 1, 'value', 'You can add new dishes', 'Here you can add new dishes, desserts, drinks, it does not matter.', '2017-08-26 07:20:54', '2017-08-26 07:20:54'),
	(586, 'Modules\\Translation\\Entities\\TranslationTranslation', 584, 1, 'value', 'Тут вы можете добавлять новые блюда, десерты, напитки, не важно, главное поля заполнить и всё)', 'Тут вы можете добавлять новые блюда, десерты, напитки, не важно. Вон справа синяя кнопка - видите? Которое "Создать блюдо" - тык по ней. Если вы её боитесь - то вот, <a href="/edit">пожалуйста</a> )', '2017-08-26 07:23:12', '2017-08-26 07:23:12'),
	(587, 'Modules\\Translation\\Entities\\TranslationTranslation', 584, 1, 'value', 'Тут вы можете добавлять новые блюда, десерты, напитки, не важно. Вон справа синяя кнопка - видите? Которое "Создать блюдо" - тык по ней. Если вы её боитесь - то вот, <a href="/edit">пожалуйста</a> )', 'Тут вы можете добавлять новые блюда, десерты, напитки, не важно. Вон справа синяя кнопка - видите? Которое "Создать блюдо" - тык по ней. Если вы её боитесь - то вот, <a href="../edit">пожалуйста</a> )', '2017-08-26 07:28:42', '2017-08-26 07:28:42'),
	(588, 'Modules\\Translation\\Entities\\TranslationTranslation', 584, 1, 'value', 'Тут вы можете добавлять новые блюда, десерты, напитки, не важно. Вон справа синяя кнопка - видите? Которое "Создать блюдо" - тык по ней. Если вы её боитесь - то вот, <a href="../edit">пожалуйста</a> )', 'Тут вы можете добавлять новые блюда, десерты, напитки, не важно. Вон справа синяя кнопка - видите? Которое "Создать блюдо" - тык по ней. Если вы её боитесь - то вот, <a href="edit/">пожалуйста</a> )', '2017-08-26 07:29:20', '2017-08-26 07:29:20'),
	(589, 'Modules\\Translation\\Entities\\TranslationTranslation', 584, 1, 'value', 'Тут вы можете добавлять новые блюда, десерты, напитки, не важно. Вон справа синяя кнопка - видите? Которое "Создать блюдо" - тык по ней. Если вы её боитесь - то вот, <a href="edit/">пожалуйста</a> )', 'Тут вы можете добавлять новые блюда, десерты, напитки, не важно. Вон справа синяя кнопка - видите? Которое "Создать блюдо" - тык по ней. Если вы её боитесь - то вот, <a href="create/">пожалуйста</a> )', '2017-08-26 07:29:56', '2017-08-26 07:29:56'),
	(590, 'Modules\\Translation\\Entities\\TranslationTranslation', 584, 1, 'value', 'Тут вы можете добавлять новые блюда, десерты, напитки, не важно. Вон справа синяя кнопка - видите? Которое "Создать блюдо" - тык по ней. Если вы её боитесь - то вот, <a href="create/">пожалуйста</a> )', 'Тут вы можете добавлять новые блюда, десерты, напитки, не важно. Вон справа синяя кнопка - видите? Которое "Создать блюдо" - тык по ней. Если вы её боитесь - то вот, <a href="dishes/create/">пожалуйста</a> )', '2017-08-26 07:30:43', '2017-08-26 07:30:43'),
	(591, 'Modules\\Translation\\Entities\\TranslationTranslation', 584, 1, 'value', 'Тут вы можете добавлять новые блюда, десерты, напитки, не важно. Вон справа синяя кнопка - видите? Которое "Создать блюдо" - тык по ней. Если вы её боитесь - то вот, <a href="dishes/create/">пожалуйста</a> )', 'Тут вы можете добавлять новые блюда, десерты, напитки, не важно. Вон справа синяя кнопка - видите? Которое "Создать блюдо" - тык по ней. Если вы её боитесь - то вот, <a href="dishes/create/">тык</a> ', '2017-08-26 07:32:04', '2017-08-26 07:32:04'),
	(592, 'Modules\\Translation\\Entities\\TranslationTranslation', 584, 1, 'value', 'Тут вы можете добавлять новые блюда, десерты, напитки, не важно. Вон справа синяя кнопка - видите? Которое "Создать блюдо" - тык по ней. Если вы её боитесь - то вот, <a href="dishes/create/">тык</a> ', 'Тут вы можете добавлять новые блюда, десерты, напитки, не важно. Вон справа синяя кнопка - видите? Которое "Создать блюдо" - тык по ней. Если вы её боитесь - то можно и сюда тыкнуть:  <a href="dishes/create/">тык</a> ', '2017-08-26 07:32:52', '2017-08-26 07:32:52'),
